CREATE TABLE store_subcategory (id SERIAL NOT NULL PRIMARY KEY, title varchar (50) NOT NULL, slug varchar (50) NOT NULL, category_id bigint NOT NULL REFERENCES store_category (id) DEFERRABLE INITIALLY DEFERRED, "title_en" varchar(50) NULL, "title_pt" varchar(50) NULL);
