CREATE TABLE IF NOT EXISTS "django_celery_beat_clockedschedule" ("id" SERIAL NOT NULL PRIMARY KEY, "clocked_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_celery_beat_crontabschedule" ("id" SERIAL NOT NULL PRIMARY KEY, "minute" varchar(240) NOT NULL, "hour" varchar(96) NOT NULL, "day_of_week" varchar(64) NOT NULL, "day_of_month" varchar(124) NOT NULL, "month_of_year" varchar(64) NOT NULL, "timezone" varchar(63) NOT NULL);
CREATE TABLE IF NOT EXISTS "store_product" ("id" SERIAL NOT NULL PRIMARY KEY, "title" varchar(50) NOT NULL, "slug" varchar(50) NOT NULL, "description" text NOT NULL, "price" SERIAL NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" SERIAL NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "image" varchar(100) NULL, "status" varchar(50) NOT NULL, "category_id" bigint NOT NULL REFERENCES "store_category" ("id") DEFERRABLE INITIALLY DEFERRED, "subcategory_id" bigint NULL REFERENCES "store_subcategory" ("id") DEFERRABLE INITIALLY DEFERRED, "image_2" varchar(100) NULL, "image_3" varchar(100) NULL, "image_4" varchar(100) NULL, "userprofile_id" bigint NULL REFERENCES "userprofile_userprofile" ("id") DEFERRABLE INITIALLY DEFERRED, "brand" varchar(20) NULL, "model" varchar(20) NULL, "condition" varchar(50) NULL);
CREATE TABLE IF NOT EXISTS "jet_bookmark" ("id" SERIAL NOT NULL PRIMARY KEY, "url" varchar(200) NOT NULL, "title" varchar(255) NOT NULL, "user" SERIAL unsigned NOT NULL CHECK ("user" >= 0), "date_add" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "jet_pinnedapplication" ("id" SERIAL NOT NULL PRIMARY KEY, "app_label" varchar(255) NOT NULL, "user" SERIAL unsigned NOT NULL CHECK ("user" >= 0), "date_add" datetime NOT NULL);
